import React, {Component} from 'react';


class Test extends components{
	
	
	render(){
		return(
			<div>
				<input type="button" onClick={function(){
					fetch('/board/send'
					,{
					method :"POST",
					headers:{
						'content-type':'application/json'
					},
					body:JSON.stringify(this.state.contents)
					})
					.then(res=>res.json())
					.then(data=>console.log(data));
				}.bind(this)}></input>	
			</div>
		);
	}
}

export default Test;
